    false,nt"url": null,nt"notes": "A time series of scale samples (1956  2002)
    collected from adult sockeye salmon returning to Naknek River were retrieved from
    the Alaska Department of Fish and Game. These scales were digitized, revealing growth
    information for the freshwater and marine life history stages of sockeye salmon.
    The growth information will be related to time series of sockeye salmon production
    to Bristol Bay and oceanographic conditions within the Bering Sea and North Pacific
    Ocean.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
